import React from 'react'
import './ImageLinkForm.css'
const ImageLinkForm=({onFileChange,onFileUpload})=>{
	return(
		<div>
			<p className='f3 center'>
				{"This magic Brain will do the genre-analysis of your song.Give it a try"}
			</p>

			<div className='center form pattern'>
			    <div className='center'>
		             <input className='f4 pa2 w-200 ' type='file' onChange={onFileChange}/>
		             <button className='w-30 grow f4 link ph3 pv2 dib white bg-light-purple ' onClick={onFileUpload}>Detect</button>
	            </div>
			</div>
		</div>

	);
}

export default ImageLinkForm;
